import { Route, Switch } from "react-router";
import AllQuotes from "./pages/AllQuotes";

function App() {
  return (
   <Switch>
     <Route path='/quotes'> 
<AllQuotes/>
     </Route>
   </Switch>
  );
}

export default App;
